function TodoApp() {
    return(
        <div>
            My Todo App
            <Login/>
        </div>
    );
}

function Login() {
    return(
        <div>
            <div>
                <label for="username"> Username </label>
                <input type = "text" name = "username" defaultValue = "username"/>
            </div>
            
            <div>
                <label for="password"> Password </label>
                <input type = "text" name = "password" defaultValue = "password"/>
            </div>
            <button> Login </button>
        </div>
    );
}

export default TodoApp;
